import  {Component} from "react";
import { Link } from "react-router-dom";
import './Navbar.css';


class NavBar extends Component{
    render(){
        return(
            <div style={{display:"flex",padding:'0.5rem',color:"blue",justifyContent:"space-evenly"}}>
            <Link to="/" style={{textDecoration:"none",marginTop:"1rem"}} ><h1>Movies App</h1></Link>
            <Link to="/favourites" style={{textDecoration:"none",marginTop:"1rem"}}><h2 style={{marginLeft:"0.2rem",marginTop:"0.5rem"}}>Favourites</h2></Link>
            </div>
        )
    }
}

export default NavBar
